import MediumBox from "../components/MediumBox";
import UpMargin from "../components/UpMargin";
import styles from "./Detail.module.css";

const OLED = () => {
  return (
    <section>
      <LargeBox />
      <UpMargin />
      <DetailTitle title="OLED Equipment" info="" details="" />
      <div className={styles.mediumBox_area}>
        <MediumBox />
        <MediumBox />
      </div>
    </section>
  );
};

export default OLED;
